import React from 'react';
import { useNavigate } from 'react-router-dom';

const Events = () => {
  const navigate = useNavigate();
  
  const events = [
    { id: 1, title: 'üé§ Music Festival 2024', description: 'Biggest music event of the year!', date: '2024-12-15', venue: 'Main Auditorium' },
    { id: 2, title: 'üíª Tech Conference', description: 'Latest in technology and innovation', date: '2024-11-20', venue: 'Tech Park' },
    { id: 3, title: '‚öΩ Sports Tournament', description: 'Annual sports competition', date: '2024-10-25', venue: 'Sports Ground' }
  ];

  const handleRegister = (eventTitle) => {
    alert(`Registered for: ${eventTitle}`);
  };

  return (
    <div style={styles.container}>
      <h1 style={styles.title}>Upcoming Events</h1>
      <div style={styles.eventsGrid}>
        {events.map(event => (
          <div key={event.id} style={styles.eventCard}>
            <h3 style={styles.eventTitle}>{event.title}</h3>
            <p style={styles.eventDescription}>{event.description}</p>
            <div style={styles.eventDetails}>
              <p><strong>Date:</strong> {event.date}</p>
              <p><strong>Venue:</strong> {event.venue}</p>
            </div>
            <button style={styles.registerBtn} onClick={() => handleRegister(event.title)}>
              Register Now
            </button>
          </div>
        ))}
      </div>
      <button style={styles.backBtn} onClick={() => navigate('/')}>
        ‚Üê Back to Home
      </button>
    </div>
  );
};

const styles = {
  container: { maxWidth: '1200px', margin: '0 auto', padding: '40px 20px', minHeight: '80vh' },
  title: { textAlign: 'center', color: 'white', fontSize: '3rem', marginBottom: '40px' },
  eventsGrid: { display: 'grid', gridTemplateColumns: 'repeat(auto-fit, minmax(300px, 1fr))', gap: '30px', marginBottom: '40px' },
  eventCard: { background: 'rgba(255,255,255,0.95)', padding: '25px', borderRadius: '15px', textAlign: 'center' },
  eventTitle: { color: '#333', marginBottom: '15px', fontSize: '1.4rem' },
  eventDescription: { color: '#666', marginBottom: '20px' },
  eventDetails: { color: '#333', marginBottom: '20px', textAlign: 'left' },
  registerBtn: { background: '#28a745', color: 'white', border: 'none', padding: '12px 24px', borderRadius: '8px', cursor: 'pointer', fontSize: '16px', fontWeight: '600', width: '100%' },
  backBtn: { background: '#6c757d', color: 'white', border: 'none', padding: '12px 24px', borderRadius: '8px', cursor: 'pointer', fontSize: '16px', margin: '0 auto', display: 'block' }
};

export default Events;
